  "<ul>\n<li>Bánh bi Bebecook có đường kính là 15-18mm vừa với bàn tay nhỏ của bé, những viên bi giòn giòn, xốp xốp, dễ tan trong miệng cùng hương vị thơm ngậy của bắp ngô và chuối.</li>\n<li>Nguồn nguyên liệu sản xuất bánh bi Bebecook được canh tác tại Hàn Quốc, giống cây trồng tuyển chọn kỹ càng, không phân bón hóa học, không biến đổi gen nên mẹ yên tâm cho bé sử dụng.</li>\n<li>Bánh dành cho bé từ 1 tuổi, mẹ có thể dùng bánh bi làm bữa phụ cùng 1 cốc sữa là đủ năng lượng và dinh dưỡng cho bé, hoặc mẹ kết hợp ăn với sữa chua, kem sẽ thật hấp dẫn.</li>\n<li>Bánh bi Bebecook được thiết kế bao bì xinh xắn, đóng gói dạng túi zip giúp mẹ dễ dàng bảo quản khi bé ăn không hết.</li>\n</ul>\n<p><strong>– Thành phần</strong>: Bắp xay (100% bắp: Úc, Brazil, Nga…) 59,375%, đường nâu hữu cơ [đường hữu cơ (Brazil) 37,5%, bơ ca cao (Peru) 25%, khối lượng ca cao, sữa bột nguyên chất hỗn hợp, lecithin (đậu tương): Chất nhũ hóa] 28%, bột chuối (Philippines) 5%, gạo đen (nội địa) 3.125%, đường hữu cơ 3%, bột đậu đỏ (nội địa) 1%, muối biển.</p>\n<p><strong>– Chất dinh dưỡng</strong>: Calo 111 kcal, carbohydrate 19g (6%), đường 4g (4%), protein 2g (4%), chất béo 3g (6%), chất béo bão hòa 1,7g (11%), chất béo chuyển hóa 0g, Cholesterol 0 mg (0%), Natri 22 mg (1%).</p>\n<p><strong>– Hạn sử dụng</strong>: 12 tháng kể từ ngày sản xuất</p>\n<p>– <strong>Quy cách đóng gói</strong>: 25g</p>\n",
